import { useState } from "react";

const Hooks = () => {
    let [count,setCount]=usestate(0)
    let handleClick=()=>{
        setCount(count++)
    }
    return ( 
        <div className="hooks">
            <h1>You clicked {count} times</h1>
            <button onClick={handleClick}>Count</button>
        </div>
     );
}
 
export default Hooks;
















